// Get the URL from n8n input
const url = $input.first().json.url;

// Function to extract YouTube video ID
function getVideoId(url) {
  if (!url) return null;
  const match = url.match(/(?:v=|youtu\.be\/|embed\/)([^&\n?#]+)/);
  return match ? match[1] : null;
}

// Extract the video ID
const videoId = getVideoId(url);

// Return the result for n8n
return {
  json: {
    url: url,
    videoId: videoId,
    success: videoId ? true : false
  }
};

const data = $input.first().json;

return {
  json: {
    fullTranscript: data.tracks[0].transcript.map(segment => segment.text).join(' ')
  }
};

// Get the video_url from n8n input
const url = $input.first().json.body.video_url;

// Function to extract YouTube video ID
function getVideoId(url) {
  if (!url) return null;
  const match = url.match(/(?:v=|youtu\.be\/|embed\/)([^&\n?#]+)/);
  return match ? match[1] : null;
}

// Extract the video ID
const videoId = getVideoId(url);

// Return the result for n8n
return {
  json: {
    url: url,
    videoId: videoId,
    success: !!videoId
  }
};

const data = $input.first().json;

let fullTranscript = null;

// ✅ If transcript exists in POST response
if (data.tracks && data.tracks.length > 0) {
  fullTranscript = data.tracks[0].transcript
    .map(segment => segment.text)
    .join(' ');
}

// ✅ Fallback if transcript missing
if (!fullTranscript && data.microformat?.playerMicroformatRenderer?.description?.simpleText) {
  fullTranscript = data.microformat.playerMicroformatRenderer.description.simpleText;
}

return {
  json: {
    id: data.id,
    title: data.title,
    channel: data.microformat?.playerMicroformatRenderer?.ownerChannelName,
    publishDate: data.microformat?.playerMicroformatRenderer?.publishDate,
    duration: data.microformat?.playerMicroformatRenderer?.lengthSeconds,
    category: data.microformat?.playerMicroformatRenderer?.category,
    fullTranscript,
    hasTranscript: (data.tracks?.length ?? 0) > 0
  }
};
